  state = {
    items: [
      {id:1,name:"Alaa",age:25},
      {id:1,name:"Zeyad",age:25},
      {id:1,name:"Ahmed",age:24},
      {id:1,name:"Mahmoud",age:24}
    ]
  }

  deleteItem = (id) => {
    console.log(id)
  }

  render() {
    return (
      <div className="App">
        To Do List App
        <TodoItems items={this.state.items} deleteItem={this.deleteItems} />
        <AddItem />
      </div>
    );
  }
}

export default App;
